import React from 'react'
import Header from './Header';
import Home from './Home';
import About from "./About";
import Service from './Service';
import Project from './Project';
import Contact from './Contact';
import Footer from "./Footer";


function Main() {
  return (
    <div>
     <Header />
     <Home />
     <About />
     <Service />
     <Project />
     <Contact />
   
     <Footer />
    </div>
  )
}

export default Main
